import React from 'react';
import PausePlayButton from "./Song";
import Next from "./NextButton";
import Previous from "./PreviousButton";

const Current = props => {
    return (
        <div position="absolute">
            <img src="https://www.w3schools.com/images/picture.jpg" alt="Mountain"> </img>
            <div className="title">
                {props.title}
            </div>
            <div className="buttons">
                <Next />
                <PausePlayButton />
                <Previous />
            </div>
        </div>
    );
}

export default CurrentlyPlaying;
